<template>
  <div v-if="show_dis" class="distribution-container">
    <div class="goods-share">
      <div class="inner-share-fenxoao" @click="showQRCode"></div>
    </div>
    <el-dialog title="分享我的链接" :visible.sync="isShowQRCode"  width="30%">
      <qrcode-vue :value="config.value" :size="config.size" level="H" style="text-align: center"></qrcode-vue>
      <el-form :inline="true" class="demo-form-inline">
        <el-form-item label="我的分享链接">
          <el-input v-model="config.value_pc" size="mini"></el-input>
        </el-form-item>
        <el-form-item>
          <el-button
            type="primary"
            size="mini"
            v-clipboard:copy="config.value_pc"
            v-clipboard:success="onCopy"
            v-clipboard:error="onError">复制到剪贴板</el-button>
        </el-form-item>
      </el-form>
    </el-dialog>
  </div>
</template>

<script>
  /**
   * 分销组件
   */
  import Vue from 'vue'
  import VueClipboard from 'vue-clipboard2'
  import QrcodeVue from 'qrcode.vue'
  import { Dialog, Form, FormItem, Input, Button } from 'element-ui'
  Vue.use(VueClipboard).use(Dialog).use(Form).use(FormItem).use(Input).use(Button)
  import * as API_distribution from '@/api/distribution'
  import { domain } from '@/ui-domain'
  export default {
    name: 'goods-distribution',
    components:{ QrcodeVue },
    data() {
      return {
        // 是否显示分销按钮
        show_dis: process.env.distribution,
        /** 是否显示二维码弹框 */
        isShowQRCode: false,

        config: {
          // wap端地址
          value: '',
          size: 200,
	        // PC 端地址
	        value_pc: ''
        }
      }
    },
    methods: {
      /** 显示并生成二维码 */
      showQRCode() {
        /** 登录校验 */
        const { user } = this.$store.getters
        // 如果没有登录，跳转到登录页
        if (!user) {
          this.$router.push(`/login?forward=${this.$route.fullPath}`)
        } else {
          API_distribution.generateShortLink({ goods_id: this.$route.params.id}).then(response => {
            this.isShowQRCode = true
            const _query = response.message.substring(response.message.indexOf("?"), response.message.length)
            this.config.value = `${domain.buyer_wap}/goods/${this.$route.params.id}${_query}`
            this.config.value_pc = `${domain.buyer_pc}/goods/${this.$route.params.id}${_query}`
          })
        }
    },

      /** 复制成功 */
      onCopy(e) {
        this.$message.success('已复制')
      },

      /** 复制失败 */
      onError(e) {
        this.$message.error('无法复制文本')
      }
    }
  }
</script>

