    padding: 0;
    & > .inner-share-fenxoao {
      width: 50px;
      height: 110px;
      background: url(data:imgae/png;base64,) no-repeat 0px -20px;
      background-size: 47px 115px;
      cursor: pointer;
      transition: all .3s ease-out;
      word-break: break-all;
      &:hover {
        background-position: 0px -10px;
      }
    }
  }
</style>
